// animation 
.nav-anim .bar1 {
    transform: rotate(-45deg) translate(-6px, 7px);
}
  
.nav-anim .bar2 {
    transform: translateX(200%);
    opacity: 0;
}
  
.nav-anim .bar3 {
    transform: rotate(45deg) translate(-7px, -8px);
}

//preloader

.preloader {
    width: 100vw;
    height: 100vh;
    position: absolute;
    top: 0;
    left: 0;
    background-color: $primary-color;
    z-index: 20;

    #logo {
        position: absolute;
        width: 50%;
        top: 50%;
        left: 50%;
        transform: translate(-50%,-50%);
    }
    #logo path:nth-child(1) {
        stroke-width: 8;
        stroke-dasharray: 442;
        stroke-dashoffset: 442;
        animation: line-anim 2s ease forwards;
    }
    #logo path:nth-child(2) {
        stroke-width: 8;
        stroke-dasharray: 442;
        stroke-dashoffset: 442;
        animation: line-anim 2s ease forwards .3s;
    }
    #logo path:nth-child(3) {
        stroke-width: 8;
        stroke-dasharray: 433;
        stroke-dashoffset: 433;
        animation: line-anim 2s ease forwards .6s;
    }
    #logo path:nth-child(4) {
        stroke-width: 8;
        stroke-dasharray: 290;
        stroke-dashoffset: 290;
        animation: line-anim 2s ease forwards .9s;
    }
    #logo path:nth-child(5) {
        stroke-width: 8;
        stroke-dasharray: 421;
        stroke-dashoffset: 421;
        animation: line-anim 2s ease forwards 1.2s;
    }
    #logo path:nth-child(6) {
        stroke-width: 8;
        stroke-dasharray: 433;
        stroke-dashoffset: 433;
        animation: line-anim 2s ease forwards 1s;
    }
    #logo path:nth-child(7) {
        stroke-width: 8;
        stroke-dasharray: 795;
        stroke-dashoffset: 795;
        animation: line-anim 2s ease forwards 0.3s;
    }
    #logo path:nth-child(8) {
        stroke-width: 8;
        stroke-dasharray: 393;
        stroke-dashoffset: 393;
        animation: line-anim 2s ease forwards 1.2s;
    }
    #logo path:nth-child(9) {
        stroke-width: 8;
        stroke-dasharray: 400;
        stroke-dashoffset: 400;
        animation: line-anim 2s ease forwards 0.3s;
    }
    #logo path:nth-child(10) {
        stroke-width: 8;
        stroke-dasharray: 393;
        stroke-dashoffset: 393;
        animation: line-anim 2s ease forwards 1.2s;
    }
    #logo path:nth-child(11) {
        stroke-width: 8;
        stroke-dasharray: 500;
        stroke-dashoffset: 500;
        animation: line-anim 2s ease forwards 1s;
    }
    #logo path:nth-child(12) {
        stroke-width: 8;
        stroke-dasharray: 400;
        stroke-dashoffset: 400;
        animation: line-anim 2s ease forwards 1.5s;
    }
    #logo path:nth-child(13) {
        stroke-width: 8;
        stroke-dasharray: 393;
        stroke-dashoffset: 393;
        animation: line-anim 2s ease forwards 0.8s;
    }

    svg {
        animation: fill .6s ease-in forwards 3s;
    }
}

@keyframes line-anim {
    to {
        stroke-dashoffset: 0;
    }
}
@keyframes fill {
    from {
        fill: transparent;
    }
    to {
        fill: $primary-color;
    }
}

